import React, { useContext } from 'react';
import { Navbar, Nav, Button } from 'react-bootstrap';
import { AuthContext } from '../context/AuthContext'; // Import AuthContext
import { useNavigate } from 'react-router-dom';

const Homepage = () => {
  const { logoutUser } = useContext(AuthContext); // Access logoutUser function from AuthContext
  const history = useHistory(); // Use useHistory for programmatic navigation
  

  const handleLogout = () => {
    logoutUser(); // Call logout function from AuthContext
    navigate('/login'); // Redirect to login page after logout
  };

  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="/">Website</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="/about">About</Nav.Link>
          <Nav.Link href="/services">Services</Nav.Link>
          <Nav.Link href="/contact">Contact</Nav.Link>
        </Nav>
        <Button variant="outline-light" onClick={handleLogout}>Logout</Button> {/* Logout button */}
      </Navbar>
      <h1>Home page</h1>
    </div>
  );
}

export default Homepage;
